import React from "react";
import Link from "next/link";
import Head from "next/head";

const Index = () => {
  return (
    <>
      <Head>
        <title>Todo List App</title>
      </Head>
      <Link href="/tasks/[id]" as={"/tasks/sldkjf"}>
        <a>ShowTask</a>
      </Link>
      <div />
      <Link href="/create_task">
        <a>CreateTask</a>
      </Link>
    </>
  );
};

export default Index;
